const useStyles = makeStyles((theme) => ({
  appBar: {
    position: 'fixed',
    flexGrow: 1,
    width: `100%`,
    margin: `0`,
    background: `#4A154B`,
    height: `50px`,
  },
  toolbar: theme.mixins.toolbar,
  menuButton: {
    marginRight: theme.spacing(1),
    marginBottom: theme.spacing(1),
  },
  title: {
    flexGrow: 1,
